import React from "react";
import Header from "./Header";
import "../css/contact.scss";

const Contact = () => {
  return (
    <div className="contactFlexContainer">
      <Header />
      <h1 className="contactFlexContainer__title">Contact</h1>
      <form className="contactFlexContainer__form" action="">
        <label className="contactFlexContainer__label" htmlFor="">
          Pseudo
          <br />
          <input className="contactFlexContainer__input" type="text" />
        </label>
        <br />
        <label className="contactFlexContainer__label" htmlFor="">
          Mail
          <br />
          <input className="contactFlexContainer__input" type="text" />
        </label>
        <br />
        <label className="contactFlexContainer__label" htmlFor="">
          Contenu
          <br />
          <input className="contactFlexContainer__input" type="text" />
        </label>
        <br />
        <button type="submit">Envoyer</button>
      </form>
    </div>
  );
};

export default Contact;
